import React from "react";
import { Navbar, Footer } from "./../index";

const About = () => {
  return (
    <>
      <Navbar />
      <section>
        <h1>About</h1>
        <div className="line_br"></div>
        <p>
          This website have purpose to sharing information through my
          persepective while iam considering something and also sharing some my
          experiences which is in past for this i hope you guys can be satisfied
          and can get benefit from this website
        </p>
      </section>

      <Footer />
    </>
  );
};

export default About;
